const pairs = {
  "speed_m_s_vs_rpm": ["speed_m_s","rpm"],
  "speed_m_s_vs_distance_m": ["speed_m_s","distance_m"],
  "speed_m_s_vs_steering_deg": ["speed_m_s","steering_deg"],
  "speed_m_s_vs_lateral_acc_m_s2": ["speed_m_s","lateral_acc_m_s2"],
  "accel_m_s2_vs_rpm": ["accel_m_s2","rpm"],
  "steering_deg_vs_lateral_acc_m_s2": ["steering_deg","lateral_acc_m_s2"],
  "speed_m_s_vs_distance_front_m": ["speed_m_s","distance_front_m"],
  "speed_m_s_vs_battery_pct": ["speed_m_s","battery_pct"]
};
function makeCard(id){
  const col=document.createElement('div');
  col.className='col-12 col-md-6';
  col.innerHTML=`<div class='card p-3'>\n<canvas id='c_${id}'></canvas>\n<div class='stat-box mt-2' id='s_${id}'></div>\n</div>`;
  document.getElementById('charts').appendChild(col);
}
function buildCharts(){
  for(const key in pairs){
    makeCard(key);
    const ctx=document.getElementById('c_'+key).getContext('2d');
    const obj=dataPairs[key];
    const [xLab,yLab]=pairs[key];
    const pts=obj.x.map((v,i)=>({x:v,y:obj.y[i]}));
    const minX=Math.min(...obj.x), maxX=Math.max(...obj.x);
    const line=[{x:minX,y:obj.intercept+obj.slope*minX},{x:maxX,y:obj.intercept+obj.slope*maxX}];
    new Chart(ctx,{type:'scatter',data:{datasets:[{label:`${yLab} zu ${xLab}`,data:pts,backgroundColor:'#1abc9c'},{label:'Regression',data:line,type:'line',fill:false,borderColor:'#e74c3c'}]},options:{animation:false,responsive:true,plugins:{legend:{labels:{color:'#fff'}}},scales:{x:{title:{display:true,text:xLab,color:'#fff'},ticks:{color:'#fff'},grid:{color:'rgba(255,255,255,0.1)'}},y:{title:{display:true,text:yLab,color:'#fff'},ticks:{color:'#fff'},grid:{color:'rgba(255,255,255,0.1)'}}}}});
    document.getElementById('s_'+key).textContent=`ŷ = ${obj.intercept.toFixed(2)} + ${obj.slope.toFixed(2)}·x | r=${obj.r.toFixed(2)} | R²=${obj.r2.toFixed(2)}`;
  }
}
buildCharts();
</script>
</body>
</html>
